<?php

namespace App\Http\Controllers;

use Illuminate\Http\Request;
Use Exception;
use Illuminate\Support\Facades\App;
use App\Models\Ticket;
use App\Models\User;
use Symfony\Component\HttpKernel\Exception\NotFoundHttpException;
use Illuminate\Support\Facades\DB;
use Illuminate\Database\Eloquent\ModelNotFoundException;
use Illuminate\Support\Facades\Mail;
use Picqer;

class TicketController extends Controller
{
    function get(Request $data)
    {
       $id = $data['id'];
       if ($id == null) {
          return response()->json(Ticket::get(),200);
       } else {
          $ticket = Ticket::findOrFail($id);
          $attach = [];
          return response()->json(["Ticket"=>$ticket, "attach"=>$attach],200);
       }
    }

    function statistics(Request $data)
    {
        $result = DB::table('tickets')
        ->select(DB::raw('user_id, attended as activo, sum(quantity) as quantity_of_wather, count(*) as num_requests'))
        ->groupBy('user_id', 'activo')
        ->get();
        return response()->json($result,200);
    }

    function get_my_requests(Request $data)
    {
       $user_id = $data['user_id'];
       return response()->json(Ticket::where('user_id', $user_id)->orderBy('id', 'DESC')->get(),200);
    }

    function getBarcode($code) {
        $barcode_generator = new Picqer\Barcode\BarcodeGeneratorPNG();
        $barcode = $barcode_generator->getBarcode($code, $barcode_generator::TYPE_CODE_128, 2, 100, [0,0,0]);
        return base64_encode($barcode);
    }

    function buildPDF($user, $quantity, $code, $barcode, $hasta, $desde) {
        $pdf_content = '<pagina>';
        $pdf_content .= '<div style="width:100%; height:500px;"></div>';
        $pdf_content .= '<div style="width:100%; margin-left: 150px; margin-right:100px;">';
        $pdf_content .= '<p>';
        $pdf_content .= 'Saludos, <strong>'.$user.'</strong><br/><br/>';
        $pdf_content .= '</p>';
        $pdf_content .= '<p>';
        $pdf_content .= 'Gracias por solicitar '.$quantity.' mL de agua.<br/><br/>';
        $pdf_content .= '</p>';
        $pdf_content .= '<p>';
        $pdf_content .= 'Su código es <br/>';
        $pdf_content .= '<img src="data:image/png;base64,'.$barcode.'"/><br/>'.$code;
        $pdf_content .= '</p>';
        $pdf_content .= '<p>';
        $pdf_content .= 'Puede hacer uso de éste ticket en el período comprendido: <br/><br/>';
        $pdf_content .= '<strong>Desde:</strong> '.$desde.'<br/>';
        $pdf_content .= '<strong>Hasta:</strong> '.$hasta;
        $pdf_content .= '</p>';
        $pdf_content .= '<p>';
        $pdf_content .= '<br/>Atentamente, <br/>';
        $pdf_content .= '<strong>'.env('APP_NAME').'</strong>';
        $pdf_content .= '</p>';
        $pdf_content .= '</div>';
        $pdf_content .= '</pagina>';
        $html = $this->sticker_style($pdf_content, $code, $barcode);
        $orientation = 'portrait';
        $pdf = App::make('dompdf.wrapper');
        $pdf->setPaper('A4', $orientation);
        $pdf->setOptions(['dpi' => 150, 'defaultFont' => 'courier']);
        $pdf->loadHTML($html);
        $bytes = $pdf->output();
        return base64_encode($bytes);
    }

    function sticker_style($content, $title, $barcode) {
        $html = '<html>';
        $html .= '   <head>';
        $html .= '      <style>';
        $html .= '         @page { margin: 0px 0px 0px 0px}';
        $html .= '         header { position: fixed; top: 0px; left: 0px; right: 0px; height: 300px; z-index: -1; }';
        $html .= '         footer { position: fixed; bottom: 0px; left: 0px; right: 0px; text-align: center; height: 175px; z-index: -1; }';
        $html .= '         p { word-spacing: 5px; width:100%; text-align:justify; }';
        $html .= '         pagina { page-break-after:always; z-index:1; }';
        $html .= '         pagina:last-child(page-break-after:never; z-index:1; }';
        $html .= '      </style>';
        $html .= '   </head>';
        $html .= '   <body>';
        $html .= '      <img style="position:fixed; left:50px; top:150px;" src="data:image/png;base64,'.$barcode.'"/>';
        $html .= '      <h4 style="position: fixed; left:75px; top:230px; font-family: Arial, Helvetica, sans-serif; text-align:left;">'. $title .'</h4>';
        $html .= '      <header>';
        $html .= '         <img style="position:fixed; left:0px; bottom:0px; top: 0px; width:1325px;" src="'.$this->get_background_image().'"/>';
        $html .= '         <h2 style="position: fixed; left:0px; right:0px; top:300px; font-family: Arial, Helvetica, sans-serif; text-align:center;">'. env('APP_NAME') .'</h2>';
        $html .= '      </header>';
        $html .= '      <footer>';
        $html .= '      </footer>';
        $html .= '      <main>';
        $html .= $content;
        $html .= '      </main>';
        $html .= '   </body>';
        $html .= '</html>';
        return $html;
    }

    function get_ticket_by_dispatcher_code(Request $data)
    {
       $dispatcher_code = $data['dispatcher_code'];
       $ticket = Ticket::where('dispatcher_code', $dispatcher_code)->where('attended', false)->first();
       if ($ticket) {
         DB::beginTransaction();
         $output = Ticket::where('id',$ticket->id)->update([
            'attended' => True,
         ]);
         DB::commit();
        return response()->json(['quantity'=>$ticket->quantity],200);
       } else {
        return response()->json(['quantity'=>0],200);
       }
    }

    function get_ticket_by_code(Request $data)
    {
       $code = $data['code'];
       return response()->json(Ticket::where('code', $code)->where('attended',false)->get(),200);
    }

    function paginate(Request $data)
    {
       $size = $data['size'];
       return response()->json(Ticket::paginate($size),200);
    }

    function check_ticket(Request $data)
    {
        $code = $data['code'];
        $user_id = $data['user_id'];
        $ticket = Ticket::where('code', $code)->where('user_id', $user_id)->first();
        if (!$ticket) {
            return response()->json(["response"=>'no existe'],200);
        } else {
            if ($ticket->attended) {
                return response()->json(["response"=>'utilizado'],200);
            }
            $now = strtotime(date("Y-m-d H:i:s"));
            $end_time = strtotime($ticket->end_time);
            if ($end_time < $now) {
                return response()->json(["response"=>'expirado'],200);
            }
            return response()->json(["response"=>'ok'],200);
        }
    }

    function post(Request $data)
    {
       try{
          $result = $data->json()->all();
          $barcode = $this->getBarcode($result['code']);
          $desde = date("Y-m-d H:i:s");
          $hasta = date('Y-m-d H:i:s',strtotime('+10 minutes',strtotime(date('Y-m-d H:i:s'))));
          DB::beginTransaction();
          $ticket = new Ticket();
          $lastTicket = Ticket::orderBy('id')->get()->last();
          if($lastTicket) {
             $ticket->id = $lastTicket->id + 1;
          } else {
             $ticket->id = 1;
          }
          $ticket->code = $result['code'];
          $ticket->dispatcher_code = $result['dispatcher_code'];
          $ticket->start_time = $desde;
          $ticket->end_time = $hasta;
          $ticket->attended = $result['attended'];
          $ticket->quantity = $result['quantity'];
          $ticket->user_id = $result['user_id'];
          $ticket->barcode = $barcode;
          $ticket->save();
          DB::commit();
          $user = User::findOrFail($result['user_id']);
          $subject = 'Código Recibido';
          $message = 'Gracias por solicitar '.$result['quantity'].' mL de agua.';
          $code = $result['code'];
          $pdf_b64 = $this->buildPDF($user->name, $result['quantity'], $code, $barcode, $hasta, $desde);
          $this->send_mail($user->email, $user->name, $subject, $message, env('MAIL_FROM_ADDRESS'), env('MAIL_FROM_NAME'), $barcode, $code , $pdf_b64);
       } catch (Exception $e) {
          return response()->json($e,400);
       }
       return response()->json($ticket,200);
    }

    function put(Request $data)
    {
       try{
          $result = $data->json()->all();
          DB::beginTransaction();
          $ticket = Ticket::where('id',$result['id'])->update([
             'code' => $result['code'],
             'dispatcher_code' => $result['dispatcher_code'],
             'start_time' => $result['start_time'],
             'end_time' => $result['end_time'],
             'attended' => $result['attended'],
             'quantity' => $result['quantity'],
             'user_id' => $result['user_id'],
          ]);
          DB::commit();
       } catch (Exception $e) {
          return response()->json($e,400);
       }
       return response()->json($ticket,200);
    }

    function delete(Request $data)
    {
       $id = $data['id'];
       return response()->json(Ticket::destroy($id),200);
    }

    function backup(Request $data)
    {
       $tickets = Ticket::get();
       $toReturn = [];
       foreach( $tickets as $ticket) {
          $attach = [];
          array_push($toReturn, ["Ticket"=>$ticket, "attach"=>$attach]);
       }
       return response()->json($toReturn,200);
    }

    function masiveLoad(Request $data)
    {
      $incomming = $data->json()->all();
      $masiveData = $incomming['data'];
      try{
       DB::beginTransaction();
       foreach($masiveData as $row) {
         $result = $row['Ticket'];
         $exist = Ticket::where('id',$result['id'])->first();
         if ($exist) {
           Ticket::where('id', $result['id'])->update([
             'code' => $result['code'],
             'dispatcher_code' => $result['dispatcher_code'],
             'start_time' => $result['start_time'],
             'end_time' => $result['end_time'],
             'attended' => $result['attended'],
             'quantity' => $result['quantity'],
             'user_id' => $result['user_id'],
             'barcode' => $result['barcode'],
           ]);
         } else {
          $ticket = new Ticket();
          $ticket->id = $result['id'];
          $ticket->code = $result['code'];
          $ticket->dispatcher_code = $result['dispatcher_code'];
          $ticket->start_time = $result['start_time'];
          $ticket->end_time = $result['end_time'];
          $ticket->attended = $result['attended'];
          $ticket->quantity = $result['quantity'];
          $ticket->user_id = $result['user_id'];
          $ticket->barcode = $result['barcode'];
          $ticket->save();
         }
       }
       DB::commit();
      } catch (Exception $e) {
         return response()->json($e,400);
      }
      return response()->json('Task Complete',200);
    }

    protected function send_mail($to, $toAlias, $subject, $body, $fromMail, $fromAlias, $barcode, $code, $pdf) {
        $data = ['name'=>$toAlias, 'body'=>$body, 'barcode'=>$barcode, 'code'=>$code, 'appName'=>env('MAIL_FROM_NAME')];
        Mail::send('barcode', $data, function($message) use ($to, $toAlias, $subject, $fromMail,$fromAlias, $code, $pdf) {
          $message->to($to, $toAlias)->subject($subject);
          $message->from($fromMail,$fromAlias);
          $message->attachData(base64_decode($pdf), $code.'.pdf', ['mime' => 'application/pdf']);
        });
        return response()->json("Success!",200);
    }

    function get_background_image() {
        $toReturn = "data:image/png;base64,";
        return $toReturn;
    }
}
